#
# Procedure "alta_alumnos_tienen_familiares"
#

CREATE PROCEDURE `alta_alumnos_tienen_familiares`(IN _idalumnos int, IN _idfamiliares int, IN _parentesco enum('MADRE','PADRE','TUTOR'))
BEGIN
DECLARE f, a int;
DECLARE p enum('MADRE','PADRE','TUTOR');
SET f=_idfamiliares;
SET a=_idalumnos;
SET p=_parentesco;
IF (SELECT count(idAlumnos) from  Alumnos WHERE idAlumnos=a) = 1 THEN
IF (SELECT count(idFamiliares) from  Familiares WHERE idFamiliares=f) = 1 THEN
IF (SELECT count(*) from  alumnos_tienen_familiares WHERE idFamiliares=f AND idAlumnos=a) < 1 THEN
INSERT INTO alumnos_tienen_familiares (idFamiliares, idAlumnos, Parentesco) VALUES (f, a, p);
END IF;
END IF;
END IF;
END;

#
# Procedure "altaAlumnos"
#

CREATE PROCEDURE `altaAlumnos`(IN _nombre varchar(45),
IN _apellido varchar(45),
IN _dni int(11),
IN _FechaNac date,
IN _direccion varchar(100),
IN _localidad varchar(100),
IN _telefono int(11) unsigned,
IN _mail varchar(100),
IN _legajo int(11),
IN _estado enum('REGULAR','LIBRE','EGRESADO'))
BEGIN
declare d INT(11);
SET d=_dni;
IF (SELECT count(*) from  alumnos WHERE DNI=d) < 1 THEN
INSERT INTO alumnos (Nombre, Apellido, DNI, FechaNac, Direccion, Localidad, Telefono, Mail, Legajo, Estado) VALUES (_nombre, _apellido, _dni, _FechaNac, _direccion, _localidad, _telefono, _mail, _legajo, _estado);
END IF;
END;

#
# Procedure "altaAlumnosEstanEnCursos"
#

CREATE PROCEDURE `altaAlumnosEstanEnCursos`(IN _idalumnos int unsigned,
 IN _idcursos int unsigned, IN _norden int unsigned, IN _idperiodos int unsigned)
BEGIN
declare a, c, p int unsigned;
SET a=_idalumnos;
SET c=_idcursos;
SET p=_idperiodos;
IF (SELECT count(*) from  alumnos_estan_en_cursos WHERE idAlumnos=a AND idCursos=c AND idPeriodoLectivo=p)<1 THEN
INSERT INTO alumnos_estan_en_cursos (idAlumnos, idCursos, Norden, idPeriodoLectivo) VALUES (a, c, _norden, p);
INSERT INTO notas (idAlumnos, idAsignaturas, idPeriodoLectivo, idCursos) SELECT
alumnos.idAlumnos,
asignaturas.idAsignaturas,
alumnos_estan_en_cursos.idPeriodoLectivo,
cursos.idCursos
FROM
alumnos
INNER JOIN alumnos_estan_en_cursos ON alumnos_estan_en_cursos.idAlumnos = alumnos.idAlumnos
INNER JOIN cursos ON alumnos_estan_en_cursos.idCursos = cursos.idCursos
INNER JOIN cursos_tienen_asignaturas ON cursos_tienen_asignaturas.idCursos = cursos.idCursos
INNER JOIN asignaturas ON cursos_tienen_asignaturas.idAsignaturas = asignaturas.idAsignaturas
LEFT OUTER JOIN profesores_dictan_asignaturas_en_cursos ON profesores_dictan_asignaturas_en_cursos.idAsignaturas = asignaturas.idAsignaturas AND profesores_dictan_asignaturas_en_cursos.idCursos = cursos.idCursos
WHERE
alumnos.idAlumnos = a;
END IF;
END;

#
# Procedure "altaAsignaturas"
#

CREATE PROCEDURE `altaAsignaturas`(IN _nombre varchar(45),
IN _tipo enum('OBLIGATORIA', 'EXIMIBLE'), IN _carrera int unsigned, IN _curso varchar(45))
BEGIN
declare n, cu varchar(45);
declare ca, contador, id int unsigned;

SET n=_nombre;
SET cu=_curso;
SET ca=_carrera;
SET contador=1;

IF (SELECT count(*) from  asignaturas WHERE Nombre=n AND idCarreras=ca) < 1 THEN

INSERT INTO asignaturas (Nombre, Tipo, idCarreras) VALUES (_nombre, _tipo, ca);

SET id=(SELECT idAsignaturas from asignaturas WHERE Nombre= n);

WHILE contador<=(SELECT count(*) from cursos) DO

IF (SELECT Numero from cursos WHERE idCursos=contador AND idCarreras=ca)= cu THEN

INSERT INTO cursos_tienen_asignaturas (idCursos, idAsignaturas) VALUES (contador, id);

END IF;

SET contador = contador + 1;
END WHILE;
END IF;
END;

#
# Procedure "altaCarreras"
#

CREATE PROCEDURE `altaCarreras`(IN _nombre varchar(45))
BEGIN
declare n varchar(45);
SET n=_nombre;
IF (SELECT count(*) from  carreras WHERE Nombre=n) < 1 THEN
INSERT INTO carreras (Nombre) VALUES (_nombre);
END IF;

END;

#
# Procedure "altaCorrelativas"
#

CREATE PROCEDURE `altaCorrelativas`(IN _idasignatura int unsigned, 
IN _idcorrelativa int unsigned, IN _examen enum ('APROBADA','REGULAR'), 
IN _cursado enum('APROBADA','REGULAR'))
BEGIN
declare a, c int unsigned;
SET a=_idasignatura;
SET c=_idcorrelativa;
IF (a<>c) THEN
