IF _tipo = 'AUSENTE' THEN
INSERT INTO inasistencias (Fecha, Lugar, Tipo, Cantidad, Turno, idAlumnos, Justificacion, Nota, idPeriodoLectivo) VALUES (_fecha, _lugar, _tipo, 0.5, _turno, _idalumnos, _justificacion, _nota, _idperiodolectivo);
