    IF (SELECT count(*) from  cursos_tienen_asignaturas WHERE idAsignaturas=a AND idPeriodolectivo=pl)<1 THEN
    
INSERT INTO profesores_dictan_asignaturas_en_cursos (idProfesores, idAsignaturas, idCursos, idPeriodolectivo) VALUES (p, a, c, pl);
END IF;
END IF;
END IF;
END;

#
# Procedure "altaSanciones"
#

CREATE PROCEDURE `altaSanciones`(IN _denunciante varchar(45), IN _motivo varchar(255),
IN _cantidad int(11) unsigned, IN _fecha date, IN _idalumnos INT UNSIGNED, IN _idperiodolectivo int)
BEGIN

IF (SELECT count(*) from  alumnos_estan_en_cursos WHERE idAlumnos=_idalumnos AND idPeriodoLectivo=_idperiodolectivo) = 1 THEN
INSERT INTO sanciones (Denunciante, Motivo, Cantidad, Fecha, idAlumnos, idPeriodolectivo) VALUES (_denunciante, _motivo, _cantidad, _fecha, _idalumnos, _idperiodolectivo);
INSERT INTO inasistencias (Fecha, Lugar, Tipo, Cantidad, Turno, idAlumnos, Justificacion, Nota, idPeriodoLectivo) VALUES (_fecha, 'N/C', 'SUSPENSION', _cantidad, 'N/C', _idalumnos, 'N/C', _motivo, _idperiodolectivo);
END IF;
END;

#
# Procedure "altaTP"
#

CREATE PROCEDURE `altaTP`(IN _nombre varchar(45), IN _fasig date, IN _fentrega date, 
IN _idasignaturas int unsigned, IN _idprofesores int unsigned, IN _idcursos int unsigned, IN _idcuatrimestre int unsigned)
BEGIN
declare n varchar(45);
declare a, p, c, cuat int unsigned;
SET n=_nombre;
SET a=_idasignaturas;
SET p=_idprofesores;
SET c=_idcursos;
SET cuat=_idcuatrimestre;


IF (SELECT count(*) from  profesores_dictan_asignaturas_en_cursos WHERE idProfesores=p AND idAsignaturas=a AND idCursos=c)=1 THEN

IF (SELECT count(*) from  trabajospracticos WHERE Nombre=n AND idAsignaturas=a AND idProfesores=p AND idCursos=c AND idCuatrimestre=cuat)<1 THEN

INSERT INTO trabajospracticos (Nombre, FechaAsignacion, FechaEntrega, idAsignaturas, idProfesores, idCursos, idCuatrimestre) VALUES (n, _fasig, _fentrega, a, p, c, cuat);

END IF;
END IF;

END;

#
# Procedure "AM_AlumnosPresentanTP"
#

CREATE PROCEDURE `AM_AlumnosPresentanTP`(IN _idalumnos int, IN _idtrabajospracticos int, IN _estado enum('APROBADO','DESAPROBADO'))
BEGIN
DECLARE tp, a int;
DECLARE e enum('APROBADO','DESAPROBADO');
SET tp=_idtrabajospracticos;
SET a=_idalumnos;
SET e=_estado;
IF (SELECT count(*) from  trabajospracticos WHERE idTrabajosPracticos=tp) = 1 THEN
IF (SELECT count(*) from  alumnos_presentan_trabajospracticos WHERE idTrabajosPracticos=tp AND idAlumnos=a) < 1 THEN
INSERT INTO alumnos_presentan_trabajospracticos (idAlumnos, idTrabajosPracticos, Estado) VALUES (a, tp, e);
END IF;
END IF;
END;

#
# Procedure "modifica_alumnos_tienen_familiares"
#

CREATE PROCEDURE `modifica_alumnos_tienen_familiares`(IN _idalumnos int, IN _idfamiliares int, IN _parentesco enum('MADRE','PADRE','TUTOR'))
BEGIN
DECLARE f, a int;
DECLARE p enum('MADRE','PADRE','TUTOR');
SET f=_idfamiliares;
SET a=_idalumnos;
SET p=_parentesco;
if(SELECT count(*) from alumnos_tienen_familiares WHERE idAlumnos=a)>0 THEN
UPDATE alumnos_tienen_familiares SET idFamiliares = f, Parentesco = p WHERE idAlumnos = a;
end if;
END;

#
# Procedure "modificaAlumnos"
#

CREATE PROCEDURE `modificaAlumnos`(IN _idalumnos int(11) unsigned, IN _nombre varchar(45),
IN _apellido varchar(45),
IN _dni int(11),
IN _FechaNac date,
IN _direccion varchar(100),
IN _localidad varchar(100),
IN _telefono int(11) unsigned,
IN _mail varchar(100),
IN _legajo int(11),
IN _estado enum('REGULAR','LIBRE','EGRESADO'))
BEGIN
declare id INT(11);
SET id=_idalumnos;
IF (SELECT count(*) from  alumnos WHERE idAlumnos=id) > 0  THEN 
UPDATE alumnos SET Nombre=_nombre, Apellido=_apellido, DNI=_dni, FechaNac=_FechaNac, Direccion=_direccion, Localidad=_localidad, Telefono=_telefono, Mail=_mail, Legajo=_legajo, Estado = _estado  WHERE idAlumno=id;
END IF;
END;
